import React from 'react';

import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import ad from './images/ad-1.png';
import Container from 'react-bootstrap/Container';
import Card from 'react-bootstrap/Card';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Image from 'react-bootstrap/Image';
import Badge from 'react-bootstrap/Badge';

function Login() {
  return (

    <>
      <div className='App-body w-100 text-white m-3 p-3' style={{ height: '100vh' }}>

        <Container fluid expand="lg">          
            {/* Login Content */}
            <Col xs lg="10" >
              <Row>
                <Col xs ys lg="4" className='lg m-0 p-3' bg="white">

                  <Form>
                    <Form.Group className="mb-3" controlId="formBasicEmail">
                      <Form.Label>Email address</Form.Label>
                      <Form.Control type="email" placeholder="Enter email" />
                      <Form.Text className="text-muted">
                        We'll never share your email with anyone else.
                      </Form.Text>
                    </Form.Group>

                    <Form.Group className="mb-3" controlId="formBasicPassword">
                      <Form.Label>Password</Form.Label>
                      <Form.Control type="password" placeholder="Password" />
                    </Form.Group>
                    <Form.Group className="mb-3" controlId="formBasicCheckbox">
                      <Form.Check type="checkbox" label="Check me out" />
                    </Form.Group>
                    <Button variant="primary" type="submit">
                      Submit
                    </Button>
                  </Form>

                </Col>
                <Col bg="light">
                  <Container>
                    <Image src={ad} rounded className='mt-3 ml-3' style={{ width: '22vh' }} />
                  </Container>

                </Col>
              </Row>
            </Col>


        </Container>
      </div>

    </>

  )
}

export default Login;
